import React, { FC } from 'react';
import Logo from "../../images/Logo.svg";


interface HeaderProps {}

const Header: FC<HeaderProps> = () => (
  <div className={"flex flex-row w-screen bg-black text-white py-4 px-8 justify-between items-center"}>
    <div className={"flex flex-row gap-12 items-center"}>
      <img className={"w-16 h-16"} src={Logo} alt={"logo"}></img>
      <div className={"prose prose-invert prose-lg"}>Work</div>
      <div className={"prose prose-invert prose-lg"}>Reviews</div>
    </div>
    <div className={"prose prose-invert text-4xl"}>Alex Richards</div>
    <div className={"prose prose-invert prose-xl"}>buttons</div>
  </div>
);

export default Header;
